// Ambil data dari node sebelumnya
const res = items[0].json;

// Ambil header kolom
const headers = res.columnHeaders.map(h => h.name);

// Ubah rows jadi array of object
const parsed = (res.rows || []).map(r => {
  const obj = {};
  headers.forEach((h, i) => obj[h] = r[i]);

  // Rename views -> views_weekly
  if (obj.views !== undefined) {
    obj.views_weekly = obj.views;
    delete obj.views;
  }

  return obj;
});

// Ambil hanya kolom video (ID)
const ids = parsed.map(v => v.video);

// Gabungkan jadi string CSV
const csv = ids.join(',');

// Return satu item dengan field videoIdsCsv + juga parsed rows
return [{
  json: {
    videoIdsCsv: csv,
    topVideos: parsed
  }
}];

