// Ambil semua item hasil merge
const arr = items.map(i => i.json);

const result = {
  overview: [],
  topVideos: [],
  trafficSources: [],
  audience: []
};

for (const item of arr) {
  // Cek apakah ini Overview (punya key 'day')
  if (item.day) {
    result.overview.push(item);
  }
  // Cek apakah ini objek gabungan TopVideos (ada 'items' dan 'topVideos')
  else if (item.items && item.topVideos) {

    // Ini bagian yang diubah
    result.topVideos = item.items.map(videoDetail => {
      // 1. Cari data analitik yang cocok berdasarkan ID video
      const analyticsData = item.topVideos.find(
        analyticsVideo => analyticsVideo.video === videoDetail.id
      );

      // 2. Gabungkan data dalam objek baru
      return {
        id: videoDetail.id,
        title: videoDetail.snippet.title,
        views_alltime: videoDetail.statistics.viewCount, // Total views seumur hidup
        views_weekly: analyticsData ? analyticsData.views_weekly : 0, // Views mingguan dari data analitik
        likes: videoDetail.statistics.likeCount,
        comments: videoDetail.statistics.commentCount,
        thumbnail: videoDetail.snippet.thumbnails?.default?.url
      };
    });
  }
  // Cek apakah ini Traffic Source (ada 'insightTrafficSourceType')
  else if (item.insightTrafficSourceType) {
    result.trafficSources.push(item);
  }
  // Cek apakah ini Audience (ada 'ageGroup')
  else if (item.ageGroup) {
    result.audience.push(item);
  }
}

return [{ json: result }];

